import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { setTvDetails } from "../../slices/TvShowSlice";
import { fetchDetails } from "../../utils/utils";
import { useParams } from "react-router-dom";
import Trailer from "./Trailer";

import { Link } from "react-router-dom";
import Keywords from "./Keywords";

const Details = () => {
  const dispatch = useDispatch();
  const { id } = useParams();
  useEffect(() => {
    async function fetchDataFunction() {
      const result = await fetchDetails(`tv/${id}?language=en-US`);
      dispatch(setTvDetails(result));
    }

    fetchDataFunction();
  }, [id]);

  const tvDetails = useSelector((state) => state.series.tvDetail.data);

  return (
    <div className="pl-10 pr-10 pt-5 pb-10">
      <Link to={`/`}>
        <div className=" flex flex-row gap-2 items-center mb-5">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            id="Bold"
            viewBox="0 0 24 24"
            width="30"
            height="30"
            className="bg-yellow-500 p-1 rounded-xl"
          >
            <path d="M4.943,5.606,1.024,9.525a3.585,3.585,0,0,0,0,4.95l3.919,3.919a1.5,1.5,0,1,0,2.121-2.121L4.285,13.492l18.25-.023a1.5,1.5,0,0,0,1.5-1.5v0a1.5,1.5,0,0,0-1.5-1.5L4.3,10.492,7.064,7.727A1.5,1.5,0,0,0,4.943,5.606Z" />
          </svg>
          <span className="font-bold text-xl">Back to Tv Shows</span>
        </div>
      </Link>
      {tvDetails && (
        <div className="flex flex-row gap-10 mb-10">
          <img
            src={`https://image.tmdb.org/t/p/original${tvDetails.poster_path}`}
            alt={tvDetails.title}
            className="w-[300px] h-auto rounded-xl"
          />
          <div className="flex flex-col gap-5">
            <div>
              <span className="text-3xl font-serif italic text-yellow-500">
                {tvDetails.title}{" "}
                {tvDetails.release_date &&
                  `(${tvDetails.release_date.split("-")[0]})`}
              </span>
            </div>
            <div className="flex flex-row gap-2  items-center">
              <li className="text-sm list-disc list-inside ">
                {tvDetails.release_date &&
                  `${tvDetails.release_date.split("-")[2]}`}
                /
                {tvDetails.release_date &&
                  `${tvDetails.release_date.split("-")[1]}`}
                /
                {tvDetails.release_date &&
                  `${tvDetails.release_date.split("-")[0]}`}
              </li>
              {tvDetails.genres?.map((item, index) => {
                return (
                  <ul
                    key={index}
                    className="list-disc inline-block list-inside"
                  >
                    <li className="text-sm">{item.name}</li>
                  </ul>
                );
              })}
              <li className="text-sm list-disc list-inside">
                {Math.floor(tvDetails.runtime / 60)}h {tvDetails.runtime % 60}
                min
              </li>
            </div>
            <div className="flex flex-row gap-3 items-center">
              {tvDetails.vote_average && (
                <div className="bg-yellow-500 rounded-xl p-1 text-black font-bold text-xl">
                  {tvDetails.vote_average.toFixed(1)}
                </div>
              )}
              <div className="flex flex-wrap">User Score</div>
              <div className="bg-yellow-500 p-1 text-black font-bold rounded-xl">
                <Trailer />
              </div>
            </div>
            <div className="flex flex-col gap-2">
              <span className="text-lg italic">{tvDetails.tagline}</span>
              <span className="text-xl font-serif font-bold">Overview</span>
              <span className="text-sm font-serif">{tvDetails.overview}</span>
            </div>
            <div className="flex flex-row items-center gap-10">
              <Link
                to={`${tvDetails.homepage}`}
                className="flex flex-row items-center gap-2 w-[170px]"
              >
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  id="Layer_1"
                  data-name="Layer 1"
                  viewBox="0 0 24 24"
                  width="30"
                  height="30"
                  className="bg-gray-400 p-1 rounded-xl"
                >
                  <path d="M7.896,16.104c-.586-.585-.586-1.536,0-2.121,.586-.586,1.535-.586,2.121,0,1.326,1.326,3.64,1.327,4.966,0l4.989-4.989c1.369-1.369,1.369-3.597,0-4.966s-3.597-1.369-4.966,0c-.586,.586-1.535,.586-2.121,0-.586-.585-.586-1.536,0-2.121,2.538-2.539,6.67-2.539,9.208,0,2.539,2.539,2.539,6.669,0,9.208l-4.989,4.989c-1.27,1.27-2.937,1.904-4.604,1.904s-3.335-.635-4.604-1.904Zm-1.384,7.893c1.667,0,3.334-.635,4.604-1.904,.586-.585,.586-1.536,0-2.121-.586-.586-1.535-.586-2.121,0-1.37,1.37-3.598,1.369-4.966,0-1.369-1.369-1.369-3.597,0-4.966l4.961-4.961c1.37-1.37,3.598-1.37,4.966,0,.586,.586,1.535,.586,2.121,0,.586-.585,.586-1.536,0-2.121-2.539-2.539-6.669-2.539-9.208,0L1.907,12.885c-2.539,2.539-2.539,6.669,0,9.208,1.27,1.27,2.937,1.904,4.604,1.904Z" />
                </svg>
                <span className="text-gray-300">Visit Homepage</span>
              </Link>
              <div className="flex flex-col">
                <span className="text-gray-300">Status:</span>
                <span className="italic text-gray-300">{tvDetails.status}</span>
              </div>
            </div>
            <Keywords />
          </div>
        </div>
      )}
    </div>
  );
};

export default Details;
